import React from 'react';
import HeroImage from '../assets/images/player-hero.svg';

function HeroSection() {
    return (
        <section className='flex justify-between items-center'>
            <ul className='w-2/5'>
                <li><h1 className='text-6xl font-bold'>Learn SQL the Fun Way: Play Games, Earn Badges, Master Queries!</h1></li>
                <li><p className='text-gray-600 mt-4'>Turn SQL learning into an engaging adventure with interactive challenges, a rewarding badge system, and a supportive community.</p></li>
                <li><a href='' className='text-white bg-blue-700 hover:bg-blue-800 focus:outline-none focus:ring-4 focus:ring-blue-300 font-medium rounded-full text-sm px-5 py-2.5 text-center me-2 mb-2'>Sign Up for Free</a></li>
            </ul>
            <img src={HeroImage} alt='' className='w-1/2 ' />
        </section>
    );
}

export default HeroSection;
